- input: "TEXT\x1CC00030718\x1C16151978\x1C\x1CF3XN\x1CFor the contra disbursement
    amounts of $100.00 on 10/16/08, $100.00 on 10/16/08, $100.00 on 10/20/08, $100.00
    on 10/20/08 & $100.00 on 10/20/08 reported on Line 21b of this report and transferred
    to Line 24, the full purpose of disbursement should be noted as: Independent Expenditure
    disseminated, see Line 24 item. These amounts relate to an original $4,250.00
    advance payment made to the National Association of Realtors for consulting services
    on 8/22/2008 and reported on Line 21b of the September 2008 monthly report. Subsequently
    in 2008, we utilized $3,250.00 of this advanced payment as consulting services
    attributable to independent expenditures & reflected as negative amounts subtracted
    from Line 21b and transferred to Line 24.  $500.00 of the original $4,250.00 is
    being utilized as consulting services attributable to independent expenditures
    & reflected on Line 24 in this period, with the full purpose of disbursement for
    each as: Transfer consulting services from Line 21b to Line 24 due to public dissemination
    of independent expenditure communication & attributed as follows: 10/16/08 $100.00
    for Christopher Shays; 10/16/08 $100.00 for Joe Knollenberg; 10/20/08 $100.00
    for Paul Kanjorski; 10/20/08 $100.00 for Ciro Rodriguez; 10/20/08 $100.00 for
    Jerry McNerney. For each of the $15,000.00 negative amounts reflected on Line
    21b for Amplify Public Affairs LLC, the full purpose of disbursement should be
    noted as: Independent Expenditure disseminated, see Line 24 item.  For the Amplify
    Public Affairs LLC payee entries reflected on Line 24, the full purpose of disbursement
    for each is: Transfer from Line 21b to Line 24 due to public dissemination of
    independent expenditure communication & attributed as follows for website design/production/operation
    costs: 10/16/08 $15,000.00 for Christopher Shays; 10/16/08 $15,000.00 for Joe
    Knollenberg; 10/20/08 $15,000.00 for Paul Kanjorski; 10/20/08 $15,000.00 for Ciro
    Rodriguez & 10/20/08 $15,000.00 Jerry McNerney.  For Line 22 of this report, the
    following entries are refunds for contributions received by this committee that
    were unacceptable. Each entry we reference contains the payee, date & amount of
    disbursement, along with the original date of receipt. The following contributions
    represented by the refunds are reported as unitemized on the 30 Day Post-Election
    report:  Georgia RPAC $135.75 on 10/29/08 orig recd 10/22/08; Maryland RPAC $30.00
    on 10/29/08 orig recd 10/20/08; Virginia RPAC $43.50 on 10/29/08 orig recd 10/22/08;
    Washington RPAC $7.50 on 11/21/08 orig recd 11/14/08. The following contributions
    represented by the refunds are reported as unitemized on the 12 Day Pre-Election
    report: New Mexico RPAC $7.61 on 10/23/08 orig recd 10/13/08. The disbursement
    reported on Line 22 payable to Washington RPAC for $993.00 on 10/29/08 represents
    a refund for a contribution originally transmitted by this state depository agent
    to our committee on 9/22/08 for Greg Wright & which we itemized on Line 11ai on
    our October 20 monthly report with the agent date of 9/9/08. On 10/28/08, we were
    advised by the state agent that Mr. Wright's check had been returned unpaid by
    the payor's bank due to insufficient funds. On 10/29/08 we refunded the state
    agent upon being advised of the situation & also are reflecting a negative itemized
    entry on Line 11ai for Mr. Wright's record in the amount of $993.00."
